If you're looking for a job that lets you do what you're good at, pays you what you're worth, read this book....Here's a one-of-a-kind book that will teach you how to get past interviewers. But that's the half of it. It'll also tell you the life lessons you need to succeed in business, in your career, in your life. When you finish reading this book, you'll know what it takes most successful people, at least, half a lifetime to learn. Lucky you found it. (quoted from the book)
